import React from "react";
import Route from "react-router-dom"

import Movies from "../apis/movies";

class MainBody extends React.Component {
    render() {
        return (
            <div>
                <Route exact path = "/movies" component = {Movies} />
            </div>
            
        )
    }
}

export default MainBody;
